import React from 'react';
import { Link } from 'react-router-dom';

const Footer = props => {
  return (
    <div className='container'>
      <div style={{ position: 'fixed', bottom: 0, backgroundColor: 'red' }}>
        {props.all.length !== 0 ? (
          <div className='row'>
            <div className='col s6' style={{ marginBottom: 0 }}>
              <Link
                to={{
                  pathname: '/billing...',
                  state: {
                    item: props.selected_items,
                    bill: props.bill,
                    all: props.all
                  }
                }}
              >
                <button className='waves-effect waves-light btn'>
                  Bill it!
                </button>
              </Link>
            </div>
            <div className='col s6'>
              <h5>Grand Total :{props.bill}</h5>
            </div>
          </div>
        ) : null}
      </div>
    </div>
  );
};

export default Footer;
